<p>I would be so grateful if you help me.
Thank you in advance !</p>; Answer: @ash Just a guess: `strcmp()` was intended to be used with ASCII. If applied to UTF-8, it will work for identical _encoded_ strings. However, in Unicode/UTF-8 are in certain cases multiple way to express the same glyph e.g. '' can be code point 252 or a 'u' and a diaresis (the upper double points). In this case, it looks equal but `strcmp()`will consider this as different.

